import "./styles.scss";

export default function PortfolioList({ selected, setSelected }) {

    return (
        <div className="portfolioList">
            <li className='active'>Featured</li>
            <li>Web Apps</li>
            <li>Mobile Apps</li>
            <li>UI/UX Design</li>
        </div>
    )
}
